import React from "react";

import Nav from "../../Components/Nav/Nav";
import Hero from "./Components/Hero";
import "../Home/Components/hero.css";
import About from "./Components/About";

const Home = () => {
  return (
    <div>
      <Nav />
      <Hero />
      <About />
    </div>
  );
};

export default Home;
